import React from 'react';
import {cardData, project1Info} from '../Widgets/CardData';

function Projects() {
  return (
    <div>
      <div className="container">
        <div className="row">
          {cardData.map((item, index) => (
            <div className="col-sm-4">
              <div class="card">
                <img src={item.cardImg} class="card-img-top" alt="..." />
                <div class="card-body">
                  <h2 class="card-title">{item.cardTitle}</h2>
                  <h4 class="card-text">使用到技術：</h4>
                  <h5>
                    <ul>
                      <li key={index}>{item.cardInfo}</li>
                    </ul>
                  </h5>
                  {/* <a href="#" class="btn btn-primary">
                  Go somewhere
                </a> */}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Projects;
